import { Box, Button, Header, Heading, Text,Grommet, Table, TableHeader, TableCell, TableBody, TableRow, ResponsiveContext } from 'grommet';
import { Hpe, Previous } from 'grommet-icons';
import React, { useState, useEffect } from 'react';
import {useHistory} from 'react-router-dom';
import Foooter from './Foooter';

function Dashboard() {

  let history = useHistory();

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };
  const size = React.useContext(ResponsiveContext);

  const [notes, setNotes] = useState([{
      Device_Requestor: '',
      Device_PR_No: '',
      Device_PO_No: ''
  }])

  useEffect(() => {
      fetch("/dashboard").then(res => {
        if(res.ok) {
          return res.json()
        }
      }).then(jsonRes => setNotes(jsonRes));
  })

  console.log(setNotes);

  return(
      <>
      <Grommet theme={theme}>
      <Header background="brand">
          <Box direction="row" gap="small" pad="medium">
              <Hpe color="White"/>
              <Text weight="bold">HPE</Text>
              <Text>Dashboard</Text>
          </Box>
      </Header>  
      
      <Box alignSelf="center"  border={{ color: 'brand', size: 'medium' }} >
        <Box pad="small">
            <Button icon={<Previous />} alignSelf="start" onClick={() => history.goBack()}/>
        </Box>
        <Heading margin={{left: 'medium'}} >Dashboard</Heading>

        <Box direction="column" alignSelf="start" pad="medium"> 
        <Box direction={size !== 'small' ? 'row' : 'column'} align="center" gap="medium" >
          <Button label="Default" primary />
        </Box>
            {notes.map(note => 
            <Box direction="column">
              <ul>
                  <li>{note.Device_Requestor} + " "+ {note.Device_PR_No} + " "+ {note.Device_PO_No}</li>
                  <li>{note.Device_PR_No}</li>
                  <li>{note.Device_PO_No}</li>
              </ul>
              </Box>
              
          
            )}
        </Box>
      </Box>
      <Foooter />
    </Grommet>
  </>
  );
}

export default Dashboard;
